import React from 'react';
import './content.css';
import Card from './card/card';
import Carousel from './carousel/carousel';
import CarouselInner from './carousel/carousel_inner';



class Content extends React.Component {
  render(){
    return(
      <div id="content" className="content container">
        <h1 class="col-12 text-center display-4 headlog">Logistic steps</h1>
        <Card/>
          <center><img src="./carousel/carousel_img/753.jpg" alt="recycle"/></center>

      </div>
    )
  }
}
export default Content
